import React from "react";
import {Tile} from "../tile/Tile"

export const TileList = ({tiles, description}) => {
  return (
    <div>
      {tiles.map((tile, index) => (
        <Tile key={index} tile={tile} description={{...tile}} className="tile-container"/>
      ))}
    </div>
  );
};

export default TileList;

